-- PARTE UM: Criar o banco
-- DROP DATABASE IF EXISTS EMPRESA;
CREATE DATABASE EMPRESA;

-- PARTE DOIS: Criar as tabelas
-- drop tables
DROP TABLE IF EXISTS EMPREGADO CASCADE;
DROP TABLE IF EXISTS DEPARTAMENTO CASCADE;
DROP TABLE IF EXISTS LOCAL CASCADE;
DROP TABLE IF EXISTS PROJETO CASCADE;
DROP TABLE IF EXISTS TRABALHAEM CASCADE;
DROP TABLE IF EXISTS DEPENDENTE CASCADE;

CREATE TABLE EMPREGADO
(
Nome VARCHAR(80),
NomeDoMeio CHAR(1),
Sobrenome VARCHAR(80),
Codigo CHAR(9),
DtNascimento DATE,
Endereco VARCHAR(100),
Sexo CHAR(1),
Salario NUMERIC(9),
Gerente CHAR(9),
Departamento NUMERIC(3),
PRIMARY KEY (Codigo),
FOREIGN KEY (Gerente) REFERENCES EMPREGADO (Codigo)
);

CREATE TABLE DEPARTAMENTO
(
Nome VARCHAR(80),
Codigo NUMERIC(3),
Gerente CHAR(9),
InicioGerente DATE,
PRIMARY KEY (Codigo),
FOREIGN KEY (Gerente) REFERENCES EMPREGADO (Codigo)
);

CREATE TABLE LOCAL
(
Departamento NUMERIC(3),
Nome VARCHAR(80),
PRIMARY KEY (Departamento, Nome),
FOREIGN KEY (Departamento) REFERENCES DEPARTAMENTO (Codigo)
);


CREATE TABLE PROJETO
(
Descricao VARCHAR(80),
Codigo NUMERIC(3),
Local VARCHAR(80),
Departamento NUMERIC(3),
PRIMARY KEY (Codigo),
FOREIGN KEY (Departamento) REFERENCES DEPARTAMENTO (Codigo)
);


CREATE TABLE TRABALHAEM
(
Empregado CHAR(9),
Projeto NUMERIC(3),
Horas NUMERIC(3,1),
PRIMARY KEY (Empregado, Projeto),
FOREIGN KEY (Empregado) REFERENCES EMPREGADO (Codigo),
FOREIGN KEY (Projeto) REFERENCES PROJETO(Codigo)
);


CREATE TABLE DEPENDENTE
(
Empregado CHAR(9),
Nome VARCHAR(80),
Sexo CHAR(1),
DtNascimento DATE,
Parentesco VARCHAR(80),
PRIMARY KEY (Empregado, Nome),
FOREIGN KEY (Empregado) REFERENCES EMPREGADO (Codigo)
);

